cordova.define("com.jiedaibao.rightnavigationbar.RightNavigationBar", function (require, exports, module) {
   var exec = require('cordova/exec');
   module.exports = {
       setRightNavigationItem : function(title, image, func, parameters, successCallback, errorCallback) {
       exec(
            successCallback,
            errorCallback,
            'RightNavigationBar',
            'setRightNavigationItem',
            [{
                "title": title,
                "image": image,
                "func": func,
                "parameters": parameters
             }]
            );
       }
    }
  }
);
